webpackJsonp([0x9cacec90c6f],{686:function(e,a){e.exports={data:{markdownRemark:{html:'<p>Some features in A Race athlete require specific data in order for that feature to be useful. If the data is not available, you will see a Feature Requirements notice.</p>\n<p>For example, we canâ€™t show you a Power to Weight history graph if your data contains no FTP or Weight data.</p>\n<p>Here are some of the checks we do and how to resolve them:</p>\n<ul>\n<li>\n<p>A Race athlete Strava Club membership - Anything that requires us to have a history of your Activities requires a club membership. Club members are allowed unlimited Activity storage while non-club members are limited to 21 activities per visit. You can join the club (<a href="https://www.strava.com/clubs/araceathlete" target="_blank" rel="nofollow">here</a>).</p>\n</li>\n<li>\n<p>To be a Strava Premium member - Much of the advanced analytics data is only available to Strava Premium members, for example, Power and Heart Rate data. Upgrade your Strava account to Premium for this feature (<a href="https://www.strava.com/premium" target="_blank" rel="nofollow">here</a>).</p>\n</li>\n<li>\n<p>An entry for FTP on Strava - The feature requires you have a current FTP on Strava (<a href="https://www.strava.com/settings/performance" target="_blank" rel="nofollow">here</a>).</p>\n</li>\n<li>\n<p>An entry for Weight on Strava - The feature requires you have a current Maximum Heart Rate on Strava (<a href="https://www.strava.com/settings/profile" target="_blank" rel="nofollow">here</a>).</p>\n</li>\n<li>\n<p>An entry for City and Country on Strava - The feature requires at least a general idea about your location for calculating your elevation or time zone <a href="https://www.strava.com/settings/profile" target="_blank" rel="nofollow">here</a>.</p>\n</li>\n</ul>',frontmatter:{title:"Feature Requirements",date:"2017-06-05T00:19:00.000Z",path:"/feature-requirements/",parent:"/home/hypersprite/Documents/code/araceathlete-gatsby-material-ui-v1/src/pages/feature-requirements/index.md absPath of file",tags:"newbie",description:null,cover:null}}},pathContext:{slug:"/feature-requirements/"}}}});
